export default class LoginScreen extends Component{
    render(){
        return(
            <View style={{
                flex: 1,
                justifyContent:'center',
                alignItems: 'center',
            }}>
                <Text>
                    LoginScreen
                </Text>
            </View>
        )
    }
}
